export default (state = 0, action) => {
  switch (action.type) {
    case "INCREMENT":
      const count = state + action.score;
      const input = {
        count,
        user: "OaT",
      };
      return;
    case "DECREMENT":
      return state - action.score;
    default:
      return state;
  }
};
